import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Register from './login/Register';
import Login from './login/Login'
import * as serviceWorker from './serviceWorker';
import moment from 'moment';
import 'moment/locale/sk';
import 'moment/locale/fr'

import * as firebase from 'firebase';

const firebaseConfig = {
  apiKey: "AIzaSyBT5cY8noKx9w6nuad8Bi1gG56EMLN1fX4",
  authDomain: "plannerapp-960c1.firebaseapp.com",
  databaseURL: "https://plannerapp-960c1.firebaseio.com",
  projectId: "plannerapp-960c1",
  storageBucket: "plannerapp-960c1.appspot.com",
  messagingSenderId: "58980743581",
  appId: "1:58980743581:web:48f9f868a574b19dda5774"
};

firebase.initializeApp(firebaseConfig);

firebase.auth().onAuthStateChanged((user) => {
  if (user) {
    // User is signed in, see docs for a list of available properties
    // https://firebase.google.com/docs/reference/js/firebase.User
    var uid = user.uid;
    ReactDOM.render(
      <App />,
      document.getElementById('root')
    );

    firebase.auth().currentUser.getIdToken(true).then(function(idToken) {
      const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ idToken: idToken })
      };
      fetch('https://europe-west1-plannerapp-960c1.cloudfunctions.net/app/api/auth', requestOptions)
          .then(response => response.json())
          .then(data => console.log(data));
    }).catch(function(error) {
      console.log(error);
    });

  } else {
    ReactDOM.render(
      <Login />,
      document.getElementById('root')
    );
    // User is signed out
    // ...
  }
});

export const AuthContext = React.createContext(null);

moment.locale('sk');

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
